import React from "react";

class Header extends React.Component {
    render() {
        return (
            <Header className="top">
             <h1> Catch of th Day</h1>
             <h3 className="tagline">
              <span>Fresh Day </span>
             </h3>
            </Header>

        )
    }
}

export default Header;
